
var CSGO777 = function(){

    'use strict';

    var initAjaxToken = function() {
        $.ajaxSetup({
            headers: {
                'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
            }
        });
    };

    var initTooltips = function() {
        $(function () {
            $('[data-toggle="tooltip"]').tooltip()
        })
    };

    return {
        init: function() {
            initAjaxToken();
            CSGO777.initTheme();
        },
        initTheme: function() {
            initTooltips();
        },
        alert: function(response) {
            return noty({
                text: response.text,
                type: response.type,
                theme: 'relax',
                layout: 'topRight',
                timeout: 5000,
                animation: {
                    open:   'animated bounceInRight',
                    close:  'animated bounceOutUp'
                }
            });
        }
    }
}();

